import React from 'react';

const Product = (props) => {
    console.log(props.product.name);
    return (
        <div className="product"> 
            <div>
              <img src={props.product.img} alt=""/>
            </div>
            <div>
                 <h4>{props.product.name}</h4>
            </div>
            
        </div>
    );
};

export default Product;
